# Executive Summary

Based on the analysis of COE prices from January 2010 to August 2024:

1. The current average COE premium across all categories is $77,266.00.
2. Category B has the highest premium at $106,101.00.
3. Year-over-year, premiums have changed by an average of 6.05%.
4. There's a strong correlation between the number of bids received and the premium price.
5. Premium volatility varies significantly across vehicle categories, with some showing more stable prices over time.

Key Observations:
- COE premiums have shown considerable fluctuation over the years, with distinct trends for each vehicle category.
- Economic factors and policy changes appear to have significant impacts on COE prices, as evidenced by sharp changes in certain periods.
- The supply-demand dynamics, represented by the relationship between bids and premiums, play a crucial role in determining COE prices.

Recommendations:
1. Monitor policy changes closely as they can lead to significant shifts in COE prices.
2. Consider the cyclical nature of COE prices when planning vehicle purchases or fleet management.
3. Pay attention to category-specific trends, as each vehicle class shows distinct pricing patterns.

        // Animate charts on scroll
        function isElementInViewport(el) {
            var rect = el.getBoundingClientRect();
            return (
                rect.top >= 0 &&
                rect.left >= 0 &&
                rect.bottom <= (window.innerHeight || document.documentElement.clientHeight) &&
                rect.right <= (window.innerWidth || document.documentElement.clientWidth)
            );
        }

        function animateChartsOnScroll() {
            var charts = document.querySelectorAll('.js-plotly-plot');
            charts.forEach(function(chart) {
                if (isElementInViewport(chart)) {
                    chart.classList.add('visible');
                }
            });
        }

        window.addEventListener('load', animateChartsOnScroll);
